INSERT INTO `yg_articles` VALUES (31, '美国之大牧场主', NULL, '作    者：陶良辰', 'http://www.biqugecom.com/0/49/', '重生八十年代美国华人富豪家族，天生就有亲和动植物的能力。科迪亚克棕熊悠然坐在屋檐下，龙猫被异国短尾猫追着跑。雪山映在湛蓝天空中，微风吹过草原，罗塔湖面荡起波澜，一望无际的薰衣草田随风摇摆。白桦林里，澳洲迷你驴探出脑袋，男孩躺葡萄架下，睡的好', '/uploads/0/31.jpg', 1550130021, 1550129913, 'xuanhuan', 'bqg2_967', NULL, '后记', 1953, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (32, '神藏', NULL, '作    者：打眼', 'http://www.biqugecom.com/0/477/', '一念之间，沧海桑田打眼带你进入古玩的世界！！！各位书友要是觉得《神藏》还不错的话请不要忘记向您QQ群和微博里的朋友推荐哦！', '/uploads/0/32.jpg', 1550130377, 1550129919, 'xuanhuan', 'bqg2_967', NULL, '第一千四百七十六章 锋芒', 2322, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (33, '乡野小农民', NULL, '作    者：吴良', 'http://www.biqugecom.com/20/20377/', '乡野穷小子林飞在山林之间被咬，因祸得福获得各种牛逼能力，他秉性纯良孝顺，靠着一身异能带领着贫困的小林村村民走出大山，冲出县城，走向世界！师承中医泰斗，悬壶济世，发扬我大中华没落的中医大道。有热血，有爱情，有兄弟之情，且看小农民林飞如何从一个', '/uploads/0/33.jpg', 1550129324, 1550129930, 'xuanhuan', 'bqg2_967', NULL, '第840章 大结局', 848, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (34, '超级海盗船', NULL, '作    者：爬泰山', 'http://www.biqugecom.com/0/242/', '我的主业是海盗，美国、英国、印度包括索马里同行都是我的打劫对象；捕鱼、打捞、走私、护航我都承接。因为我有一艘超级海盗船！同时我养了一只大龙虾，一个月噌噌往上长，现在已经成了海洋巨无霸，整天去祸害各大海洋，把各国都搞的神经兮兮的！各位书友要是', '/uploads/0/34.jpg', 1550129486, 1550129937, 'xuanhuan', 'bqg2_967', NULL, '第九百九十八章 教廷的底蕴', 1010, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (35, '我家农场有条龙', NULL, '作    者：西方蜘', 'http://www.biqugecom.com/0/298/', '雷欢喜养了一条龙，恩，货真价实的一条龙，地球上最后的一条龙。于是雷欢喜的生活就被彻底改变了。他能种出比蟠桃还要甜美的桃子，能在自家的水塘里养出真正的频临绝种的野生大黄鱼。你要千年人参？等一晚上就有，真正的千年人参。你要海马等着急用？等着，欢', '/uploads/0/35.jpg', 1550128659, 1550129945, 'xuanhuan', 'bqg2_967', NULL, '大结局', 2928, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (36, '女总裁的功夫神医', NULL, '作    者：坐墙等', 'http://www.biqugecom.com/0/744/', '你听说过男女合租吗？你体验过男女合租吗？男人女人同租一套房，她（他）们会成为恋人还是冤家？本来，霍青有着自己喜欢的女人，爷爷却给他找了一个未婚妻。他想着把婚约退掉就算了，谁想到，却在机缘巧合下跟三个女孩子住在了一起，惹出了一连串儿的麻烦、暧', '/uploads/0/36.jpg', 1550129567, 1550129951, 'xuanhuan', 'bqg2_967', NULL, '第2028章 尘埃落定（3）', 2035, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (37, '神棍医生', NULL, '作    者：沐轶', 'http://www.biqugecom.com/0/90/', '重生后，萧鹰拥有全国所有医院病案的记忆，他发现，当一个神棍医生更有钱途。头戴复古圆形墨镜，身穿对襟绸缎唐装，脚下针线纳底布鞋，手中竹骨题诗纸扇，铜嘴钢牙，断人生死；闭目掐指，算命治病。天下一切疑难杂症尽在我胸，萧某人并非浪得虚名。—————', '/uploads/0/37.jpg', 1550128641, 1550129958, 'xuanhuan', 'bqg2_967', NULL, '第332章 崭新的人生', 330, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (38, '修真渔民', NULL, '作    者：深海碧', 'http://www.biqugecom.com/0/420/', '父亲大哥出海遇事，家里欠下巨债，大学生龙海选择了回家当渔民，并意外获得五行灵珠认主，从而踏上了修真的道路。只是修真太难，还是做个渔民更加逍遥自在。“什么？深海之中竟然蕴藏着各种各样的修真资源？那还有什么说的，全是我的了。”嗯，一不小心再捡个', '/uploads/0/38.jpg', 1550129971, 1550129963, 'xuanhuan', 'bqg2_967', NULL, '第651章、大结局', 461, 0, 0, 0, 0);
