INSERT INTO `yg_articles` VALUES (41, '不朽凡人', NULL, '作    者：鹅是老', 'http://www.biqugecom.com/0/57/', '我，只有凡根，一介凡人！我，叫莫无忌！我，要不朽！各位书友要是觉得《不朽凡人》还不错的话请不要忘记向您QQ群和微博里的朋友推荐哦！', '/uploads/0/41.jpg', 1550129546, 1550129994, 'xuanhuan', 'bqg2_967', NULL, '我本一凡人（后记）', 2109, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (42, '超级战兵', NULL, '作    者：一丝不', 'http://www.biqugecom.com/0/510/', '末世“神级”异能强者，重生都市，灵魂附在了特种兵叶天辰的身上。被别人退婚的苦逼？NO！被家族抛弃，给父母带来耻辱？NO！啥叫风流？让校花痴情难忘，让女明星欲罢不能，让身家千亿的倾世美女朝思暮想；啥叫狂？拳打高富帅，脚踩官二代，只认理，不认人', '/uploads/0/42.jpg', 1550129279, 1550130001, 'xuanhuan', 'bqg2_967', NULL, '第三千一百八十七章 【海王星的形势】', 3183, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (43, '无量钱途', NULL, '作    者：人一介', 'http://www.biqugecom.com/0/216/', '一个青葱少年，孤身赴美，被诱入一个庞大的跨时空操作中。成功，则有无边的好处；失败，则受难测的惩罚。滔滔金钱为测量手段，滚滚衍生工具为核弹重武。不进则死，有我无敌！少年奋进，三军夺魄！阵斩铜兄铜弟、手刃钢铁巨人、袭杀原油巨鳄、打劫金融寡头、抢', '/uploads/0/43.jpg', 1550129275, 1550130014, 'xuanhuan', 'bqg2_967', NULL, '917 几经挣扎，漏船难免倾覆', 921, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (44, '逍遥小镇长', NULL, '作    者：全金属', 'http://www.biqugecom.com/0/51/', '要工作，要娱乐，但更要逍遥安逸的生活。高山飞雪，碧水扬帆，放马草原还能探秘深林，我的地盘风光秀美。教堂，学校，警察局；医院，社区，俱乐部，还有一个小政府要运行，作为本地最高领导人我表示压力很大。一颗领主之心，几座农牧林场。数位萌宠娇憨，一群', '/uploads/0/44.jpg', 1550130221, 1550130019, 'xuanhuan', 'bqg2_967', NULL, '《捡宝王》发布了！', 1457, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (45, '我的神灵分身', NULL, '作    者：悦燃', 'http://www.biqugecom.com/0/335/', '这是两个世界的碰撞。这是两个文明的较量。这是科学与魔法的比拼。这是一部小人物的成长。大魔王搭建起，连接魔法与地球宇宙的桥梁，牵引着诸神目光，以隐蔽的方式从天而降，微笑：“我带来了力量、荣耀、权柄和死亡！”…………吴辰接过魔王的大礼包，纠结了', '/uploads/0/45.jpg', 1550129641, 1550130026, 'xuanhuan', 'bqg2_967', NULL, '第九百零七章 十年的路（全书完）', 915, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (46, '韩定食', NULL, '作    者：静候轮', 'http://www.biqugecom.com/0/491/', '韩定食：韩式套餐。“定食”，即全席。以君王食用的膳食宫廷料理。既然是君王食用的..那么肯定很多‘菜’咯。如何挑选自己的‘菜’...请大家阅读《韩定食》！！！各位书友要是觉得《韩定食》还不错的话请不要忘记向您QQ群和微博里的朋友推荐哦！', '/uploads/0/46.jpg', 1550130372, 1550130031, 'xuanhuan', 'bqg2_967', NULL, '第六百五十三章 战吧！（完）', 1665, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (47, '修真聊天群', NULL, '作    者：圣骑士', 'http://www.biqugecom.com/0/678/', '某天，宋书航意外加入了一个仙侠中二病资深患者的交流群，里面的群友们都以‘道友’相称，群名片都是各种府主、洞主、真人、天师。连群主走失的宠物犬都称为大妖犬离家出走。整天聊的是炼丹、闯秘境、炼功经验啥的。突然有一天，潜水良久的他突然发现……群里', '/uploads/0/47.jpg', 1550129549, 1550130036, 'xuanhuan', 'bqg2_967', NULL, '第2502章 不枉活这一世', 4889, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (48, '绝品透视', NULL, '作    者：愿闻其', 'http://www.biqugecom.com/0/124/', '唐宇一家因为给爷爷看病，背负巨额债务，爷爷死后又遭遇亲戚争夺遗产，只留给他一块破石头，没想到就是这块破石头让他拥有了透视之眼。从此唐宇的生活发生了翻天覆地的变化，美女？财富？地位？我样样有！古灵精怪的小萝莉，缠着我！温柔可人的白富美，粘着我', '/uploads/0/48.jpg', 1550129187, 1550130056, 'xuanhuan', 'bqg2_967', NULL, '第2260章 我为自己代言', 2269, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (49, '从仙侠世界归来', NULL, '作    者：发狂的', 'http://www.biqugecom.com/0/687/', '五年前，萧凡突然神秘失踪，生不见人，死不见尸，没人知道他其实是去了一个广袤无边，仙神林立，妖魔横行的仙侠世界。五年后，萧凡已经在那个仙侠世界度过了漫长的五千年，带着一身神秘莫测，通天动地的能力，他又重新回来了。各位书友要是觉得《从仙侠世界归', '/uploads/0/49.jpg', 1550129400, 1550130065, 'xuanhuan', 'bqg2_967', NULL, '比较尴尬，请假一天', 4186, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (50, '寻宝美利坚', NULL, '作    者：落寞的', 'http://www.biqugecom.com/0/239/', '巍巍五千年华夏，短短一百年屈辱，多少瑰宝流失海外？名瓷，美玉，统统拿来！东洋的，西洋的，都是我的！吃了我的给我吐出来，拿了我的给我还回来！古董，文玩，美食，美女，一样都不放过！且看金沐晨如何靠着一双黄金眼，浑身豪情胆，逆袭在美利坚！各位书友', '/uploads/0/50.jpg', 1550129954, 1550130073, 'xuanhuan', 'bqg2_967', NULL, '第1306章 终章（新书道爷之肆虐娱乐圈已上传求收藏）', 1313, 0, 0, 0, 0);
