INSERT INTO `yg_articles` VALUES (52, '邪帝传人在都市', NULL, '作    者：风起闲', 'http://www.biqugecom.com/0/299/', '隋末邪帝传人苏阳,修炼《苍穹九变》奇功,重生现代,九世积累下的人脉财富,令人匪夷所思。千年不死生涯,身边美女如织,达官显贵家的千金小姐、豪气干云的江湖侠女、久居深宫的公主、欧洲皇室成员，超自然生物演变的女子。到了现代，九世种种，千丝万缕，且', '/uploads/0/52.jpg', 1550128790, 1550130082, 'xuanhuan', 'bqg2_967', NULL, '2676 恐怖变化', 2758, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (53, '无界仙皇', NULL, '作    者：石三', 'http://www.biqugecom.com/0/43/', '撑天神物流落凡间，大道金竹、太古灵桃、混沌仙葫三圣归一。四界五海之上英雄辈出，六合八荒之中龙蛇起陆！你若为敌、我便是死敌！你若为友，也需配为我友。这是一个出身中上的小子，被一个强悍的美貌寡妇吓了一哆嗦，然后幡然醒悟决定要变得强大的故事。……', '/Public/images/nocover.jpg', 1550130523, 1550130088, 'xuanhuan', 'bqg2_967', NULL, '尾声', 655, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (54, '重生之妖孽人生', NULL, '作    者：黄金战', 'http://www.biqugecom.com/0/99/', '重生不可怕，就怕重生妖孽化。林风重生回到1999年，这一年，网络和电子商务刚刚兴起，网络游戏逐渐进入玩家眼界。而林风的重生人生，将从打造他的游戏帝国开始。《传奇》在他手中成为真正的传奇，《植物大战僵尸》横扫休闲网游，收购3DO，吞并暴雪，强', '/uploads/0/54.jpg', 1550130187, 1550130187, 'xuanhuan', 'bqg2_967', NULL, NULL, 0, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (55, '最牛古董商', NULL, '作    者：老三家', 'http://www.biqugecom.com/0/149/', '要什么有什么，您说我是吹牛皮？得，您当我没说。你想要秦砖汉瓦，成，一卡车够不够？不够还有的是，不过这可是个力气活，得加钱。唐伯虎真迹有没有？笑话，买唐伯虎真迹送秋香胭脂一盒。我勒你个去，你要秦始皇的夜壶干毛，非得要？成，没问题，不过那东西可', '/uploads/0/55.jpg', 1550129568, 1550130108, 'xuanhuan', 'bqg2_967', NULL, '后记', 1224, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (56, '都市无上仙医', NULL, '作    者：断桥残', 'http://www.biqugecom.com/0/38/', '他当过搬砖工，当过酒吧服务生，当过办公室文员，当过老师，当过医生……他是千千万万打工仔中的一名，为了生计而奔波劳碌，但同时他却又是一位得上古巫王夏禹血脉传承的巫师。巫，上一横顶天，下一横立地，中间一竖直通天地，中统人与人，是真正通天达地，掌', '/uploads/0/56.jpg', 1550128772, 1550130113, 'xuanhuan', 'bqg2_967', NULL, '第一千九百八十四章 混沌教主（全书完）', 2082, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (57, '至尊小神农', NULL, '作    者：黄金万', 'http://www.biqugecom.com/20/20385/', '欢喜山村农家青年杜金山，在青梅竹马的小女伴要被人强娶的困境下，竟得到祖传玉佩中华佗的三道传承，从此精通医术、获得大量农林牧副的知识，并拥有了华佗五禽戏的强大功法，咸鱼翻身！种点奇花异草，养些珍禽异兽，和妹子看看獒园中的藏獒名犬，悠闲生活乐无', '/Public/images/nocover.jpg', 1550129013, 1550130119, 'xuanhuan', 'bqg2_967', NULL, '第2429章 一枝橄榄', 2436, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (58, '权力巅峰', NULL, '作    者：梦入洪', 'http://www.biqugecom.com/0/770/', '军人出身的柳擎宇，毅然转业进入官场，成为乡镇镇长，然而上任当天却被完全架空，甚至被晾在办公室无人理睬！且看脾气火爆，办事雷厉风行的他，如何凭借着机智头脑和层出不穷的手段，翻手间覆灭种种阴谋，步步高升！几十次微妙的官位升迁，数千场激烈的明争暗', '/uploads/0/58.jpg', 1550129144, 1550130125, 'xuanhuan', 'bqg2_967', NULL, '完本感言（柳擎宇最终职务看这里）', 2425, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (59, '八零后修道记', NULL, '作    者：钓鱼1', 'http://www.biqugecom.com/0/995/', '张叫花，再平凡不过的八零后。与同龄人比，没有什么特别。一样的吃喝拉撒，跟爹娘撒娇，跟爷爷奶奶霸蛮，跟村里小屁孩打架相骂，偷父母一毛钱去买根冰棍吃，张九斤家的葡萄藤里专捏变软的葡萄粒吃，到山里掏鸟窝……一样一样的，没有什么特别。六岁的时候经历', '/uploads/0/59.jpg', 1550128873, 1550130130, 'xuanhuan', 'bqg2_967', NULL, '第789章 真正仙界（大结局）', 798, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (60, '最强升级系统', NULL, '作    者：大海好', 'http://www.biqugecom.com/24/24747/', '你见过杀鸡爆出神级血脉的没有？你见过杀蛤蟆爆出神品武技的没有？你见过整个世界的女人为他一个人男人疯狂的没有？肩扛屠龙刀，手握诸神剑，哥就问一句，“妈的，还有谁？”宅男龙飞带着一款狂暴系统穿越而来，杀怪升级，杀人也升级，碾压三界，打爆一切不服', '/uploads/0/60.jpg', 1550129435, 1550130134, 'xuanhuan', 'bqg2_967', NULL, '第4157章 要我的命吗？', 4680, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (61, '鉴宝秘术', NULL, '作    者：北域神', 'http://www.biqugecom.com/0/233/', '从小酷爱古玩，游戏之中也选鉴宝师职业的张天元，在一次意外昏迷之后，竟然在现实中学会了游戏里的鉴宝秘术。通古贯今的陶瓷、古色古香的家具、珠圆玉润的宝石、青史留名的字画、神秘悠久的青铜器具等等，都成为了他涉猎的对象。原本只懂得玩游戏，靠着脑补古', '/uploads/0/61.jpg', 1550128861, 1550130142, 'xuanhuan', 'bqg2_967', NULL, '第四八五六章 铜镜', 4860, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (62, '捡个校花做老婆', NULL, '作    者：梁少', 'http://www.biqugecom.com/20/20341/', '校花那么多，捡个回家做老婆。华夏第一战兵回归都市，成为紫荆中学的最牛插班生！且看兵王如何玩转都市！各位书友要是觉得《捡个校花做老婆》还不错的话请不要忘记向您QQ群和微博里的朋友推荐哦！', '/uploads/0/62.jpg', 1550129142, 1550130149, 'xuanhuan', 'bqg2_967', NULL, '第2488章 罗魔头', 2688, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (63, '[点击阅读]', NULL, '作    者：花都大', 'http://www.biqugecom.com/0/147/', '一场车祸让夏天获得了透视功能，从此他踏上了一条与众不同的道路。打篮球？一个挑五个。围棋国手？让你三颗子。鉴宝，我有能看穿一切的透视眼。极品学姐，温柔学妹，还有冷冷的美女班长，制服小护士，商界女强人，一个都跑不掉。VIP群：276385889', '/uploads/0/63.jpg', 1550129406, 1550130155, 'xuanhuan', 'bqg2_967', NULL, '第8019章 强大的支援', 8020, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (64, '花都大少', NULL, NULL, 'http://www.biqugecom.com/author/%BB%A8%B6%BC%B4%F3%C9%D9', '', NULL, 1550129865, 1550129865, 'xuanhuan', 'bqg2_967', NULL, NULL, 0, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (65, '极品全能学生', NULL, '作    者：花都大', 'http://www.biqugecom.com/0/147/', '一场车祸让夏天获得了透视功能，从此他踏上了一条与众不同的道路。打篮球？一个挑五个。围棋国手？让你三颗子。鉴宝，我有能看穿一切的透视眼。极品学姐，温柔学妹，还有冷冷的美女班长，制服小护士，商界女强人，一个都跑不掉。VIP群：276385889', '/uploads/0/65.jpg', 1550129980, 1550130169, 'xuanhuan', 'bqg2_967', NULL, '第8019章 强大的支援', 8020, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (66, '恋上你的花容', NULL, '松间上弦月', 'http://www.x23us.com/html/72/72057/', '砸了帝少的车，却被抱回了家，只因我是个超级赝品。他宠她入骨她却发现自己只是替身，他一直宠的是她这张脸她想挣扎时，却发现他利用她许多，伤的她遍体鳞伤他以为自己不在乎，当她转身时，他才明白有多疼，却原来爱已深入骨髓。', '/uploads/0/66.jpg', 1550129435, 1550130180, 'nvpin', '23us', NULL, '第二百四十七章 我是来收房子的', 246, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (67, '雪落关山', NULL, '晨四郎', 'http://www.x23us.com/html/69/69735/', '每个男人都有过英雄梦，小职员石正峰穿越了，在诸侯割据的乱世之中，踏上了建功立业、叱咤风云的英雄之路......（非学术文、非脑残文，雅俗共赏）', '/uploads/0/67.jpg', 1550129934, 1550130185, 'nvpin', '23us', NULL, '第1591章 不死不休', 1583, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (68, '战国我为王', NULL, '默旋', 'http://www.x23us.com/html/72/72305/', '一位战士阴差阳错回到战国时期，在混乱的时代努力生存，战乱百姓苦不堪言，国与国之战，一支白银战甲军横空出世，谁与争锋，生存与死亡，秦朝的统一，秦朝百万强军何归何处？（本文主角非特种兵）', '/uploads/0/68.jpg', 1550129277, 1550130194, 'nvpin', '23us', NULL, '第两百八十章 突围', 279, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (69, '我的传奇岁月', NULL, '做梦无罪', 'http://www.x23us.com/html/68/68511/', '《我的传奇岁月》为作者做梦无罪创作，泡书吧为你第一时间提供做梦无罪精心编写原创我的传奇岁月及无弹窗我的传奇岁月全文免费阅读、TXT下载。各位书友要是觉得《我的传奇岁月》还不错的话请不要忘记向您QQ群和微博里的朋友推荐哦！我的传奇岁月最新章节', '/Public/images/nocover.jpg', 1550129085, 1550130202, 'nvpin', '23us', NULL, '第1484章：抢劫的', 1416, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (70, '仙迹天下', NULL, '会说话的包子', 'http://www.x23us.com/html/71/71484/', '萧洺曾是仙庠学院里一名百年不遇的天才学员，却在一夜之间变成了只考个位数的废物。就在面临退学困境之际，全国最强的杀手前来刺杀自己，一筹莫展之时，神秘高手突然出现，击退仙王。从此开启开挂人生，在没有丝毫仙气的情况下，击败全校第一，成功博取到公主', '/uploads/0/70.jpg', 1550129205, 1550130211, 'nvpin', '23us', NULL, '第一百五十四章 神仙的礼物', 141, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (71, '璀璨人生', NULL, '九节金鞭', 'http://www.x23us.com/html/71/71545/', '许多情商很高的“富白美”的女强人，但遇到徐沐风这位穷小子，却纷纷变成了低情商。老先生说：特别帅气的男人先天带魔盒，他能让美女们纷纷入瓮，不管美女情商有多高，不管她们多么高冷冰霜。徐沐风是大山里的穷小子，大学学历，一生曲折坎坷，但他很带魔盒，', '/Public/images/nocover.jpg', 1550128587, 1550130215, 'nvpin', '23us', NULL, '第一百七十章 打蛋', 169, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (72, '大周王侯', NULL, '大苹果', 'http://www.x23us.com/html/69/69538/', '前世落魄，此生可追。我来了，我已非前世之我。我已修得琉璃之眼，明澈之身，坚韧之躯，无畏之胆，虎狼之心。此番重来，必将踏破荆棘大道，逆转乾道昆仑，坐拥花团锦簇，达济天下苍生。', '/uploads/0/72.jpg', 1550129909, 1550130218, 'nvpin', '23us', NULL, '第**九章 无毒不丈夫', 880, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (73, '大魏王侯', NULL, '淡墨青衫', 'http://www.x23us.com/html/72/72437/', '没落王侯世子徐子先重生于王朝末世，奋而自救，最终临大位，成魏主。后世记，大魏之主的中兴之世过程，记述其惊才艳艳，从容不迫，以盖世之才，与群雄逐鹿，最终当凌绝顶。', '/uploads/0/73.jpg', 1550130158, 1550130223, 'nvpin', '23us', NULL, '第二百二十四章 忆昔', 224, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (74, '医流狂兵', NULL, '官场痞子', 'http://www.x23us.com/html/68/68551/', '身怀古武学和古医书的超级兵王回归都市，做警方卧底，成为黑道闻风丧胆的大枭雄，成就属于自己的金钱帝国。会针灸，专治不孕不育。会按摩，专摸校花少妇。会武功，专打装逼装酷。还有女神养成计划……', '/uploads/0/74.jpg', 1550129997, 1550130229, 'nvpin', '23us', NULL, '第一千零五十三章 突破大乘', 1034, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (75, '小道友之红山巫书', NULL, '庸小鱼', 'http://www.x23us.com/html/71/71522/', '【庸小鱼签约新书首发】地狱冥界之书流落人间，妖魔鬼怪横空出世，必然会引来许多的故事，这里有爱恨情仇，这里有勇猛搞笑，不寻常的灵异事件，看小道友一一解开隐藏在背后的谜团，作者庸小鱼，带你去红山走一走！', '/Public/images/nocover.jpg', 1550130543, 1550130235, 'nvpin', '23us', NULL, '第一百四十一章 修道', 139, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (76, '我家后院有个修仙界', NULL, '语系石头', 'http://www.x23us.com/html/71/71685/', '你家地里种庄田，我家地里种神仙！瞧不起我小农民，专门打你脸。美女前来帮种田，武林高手一旁站。人生如此多娇，爽！', '/Public/images/nocover.jpg', 1550129663, 1550130239, 'nvpin', '23us', NULL, '第561章：这才叫公平', 558, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (77, '哈利波特之罪恶之书', NULL, '弗洛伯伯', 'http://www.x23us.com/html/68/68647/', '当一个穿越者误以为自己穿越回80年代的英国，历经幼时磨难、终将在悔悟中彻底沉沦黑暗的时候，一封陌生而又熟悉的入学通知书，将他的生命重新点亮。可当他接触到更深的黑暗时，他是选择远离深渊、还是义无反顾地跳入其中？“你等着，我会很快回来的。”在圣', '/Public/images/nocover.jpg', 1550129588, 1550130244, 'nvpin', '23us', NULL, '第一千二百二十一章 破碎的沙漏', 1221, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (78, '都市小神医', NULL, '飞舞的蜜蜂', 'http://www.x23us.com/html/72/72124/', '神医下山，春色无边。神医小霸王吕小墨奉命下山治病，本想安安静静做个小神医。奈何富家千金、火爆女警、美女护士…一个个闯进他的生活，吕小墨表示压力山大，城里人花销辣么大，怎么养是个大问题。', '/Public/images/nocover.jpg', 1550128784, 1550130255, 'nvpin', '23us', NULL, '第一百九十五章 魏胖子机智脱逃', 195, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (79, '绿茵风暴', NULL, '龙们客', 'http://www.x23us.com/html/70/70939/', '2007年的那个夏天，一位名叫顾振的年轻人，心怀梦想，从德意志起航，在世界足坛掀起巨星风暴，开创了一个传奇大时代。', '/Public/images/nocover.jpg', 1550128987, 1550130261, 'nvpin', '23us', NULL, '第【273】章：为什么记吃不记打', 790, 1, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (80, '太阿大帝', NULL, '楠神z', 'http://www.x23us.com/html/72/72596/', '万物之始皆为零，万物之末归为零；零为本，力为根，红尘宇内吾为尊。我这一世，不求长生，不问永恒，只愿踏遍六道红尘，笑傲宇内苍生。我叫白玉风，也有人叫我白玉疯，疯子的风。', '/Public/images/nocover.jpg', 1550129590, 1550130267, 'nvpin', '23us', NULL, '第七十三章 威逼楚南生', 72, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (81, '绿茵巨头', NULL, '空念惊海', 'http://www.x23us.com/html/71/71556/', '景阳记事开始就不知道自己父母是谁，只是知道当初被送到孤儿院的时候有一个足球在身边，除了工作外最喜欢的就是看足球，在玩fm游戏的时候不慎触电身亡，重生到一位意大利小伙身上，依靠前世的记忆，在2015年趁机收购了破产的帕尔马俱乐部，利用脑中的系', '/Public/images/nocover.jpg', 1550130304, 1550130275, 'nvpin', '23us', NULL, '第二百四十一章：传奇的谢幕上', 241, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (82, '桃运邪医', NULL, '啤酒二两', 'http://www.x23us.com/html/68/68581/', '他是医术界让人首屈一指的药神，却不幸殒命，灵魂带着使命重回都市，面对高冷总裁，冷艳杀手，极品大小姐，各种诱惑不断，叶晨深感头痛：“咳咳，别脱衣服…..我是医生，卖艺……咳….不卖身...”', '/uploads/0/82.jpg', 1550129751, 1550130280, 'nvpin', '23us', NULL, '第一千六百一十七章 大妖飞廉', 1618, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (83, '都市仙王', NULL, '意通明', 'http://www.x23us.com/html/71/71548/', '苍龙血脉、灵源桑木，三世人生。剑指苍穹，踏血而行，这一世，必将崛起！逆我者，终将毁灭！收藏、红票、评论，都不要钱，你看到这本书就是缘分，留个脚印再走吧！企鹅群：731641531欢迎大家进群瞎聊！还有一本《老子是宗主》即将完本，不用养，可以', '/Public/images/nocover.jpg', 1550129761, 1550130293, 'nvpin', '23us', NULL, '第0443章 踩进泥里', 443, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (84, '妙手神农', NULL, '夜猛', 'http://www.x23us.com/html/69/69013/', '古老的东方，生活着龙的传人，千万年来，龙的传人坚信龙的存在，我们一起期待，获得龙珠的余飞，如何从小农民起步，阅尽天下美女，拳打装逼犯，脚蹬二世祖，玩转世界各国，让我泱泱中华腾飞而起，屹立于世界之巅，壮哉我中华之龙！', '/uploads/0/84.jpg', 1550129597, 1550130302, 'nvpin', '23us', NULL, '第一千零一十二章 背锅侠', 988, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (85, '九龙拉棺', NULL, '小丑', 'http://www.x23us.com/html/72/72599/', '爷爷临死前留给我一条鱼苗，我把它当成普通的观赏鱼来养，谁知道它竟然是要喝人血的……', '/Public/images/nocover.jpg', 1550129186, 1550130308, 'nvpin', '23us', NULL, '第九十九章 婚礼上撞邪', 98, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (86, '未来兵王在都市', NULL, '动力疯子', 'http://www.x23us.com/html/72/72592/', '“我永远不会离弃我的战友，让他落在敌人手中！”“我永远不会在战场上投降，让我的祖国蒙辱！”“如果需要，我将为国捐躯；如果必要，最后一颗子弹留给我！”', '/uploads/0/86.jpg', 1550129768, 1550130313, 'nvpin', '23us', NULL, '735', 721, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (87, '三界主宰', NULL, '雪参', 'http://www.x23us.com/html/72/72424/', '比武魂？我拥有逆天武魂！比功法？我拥有无上古法！比妖宠？我拥有最强神兽！比经验？我拥有两世记忆！秦帝重生，快意恩仇，镇杀皆敌，征服绝色，主宰三界！', '/uploads/0/87.jpg', 1550129093, 1550130328, 'nvpin', '23us', NULL, '第542章 司空血影', 499, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (88, '庶女撩夫日常', NULL, '公子轻影', 'http://www.x23us.com/html/72/72313/', '剖腹，取子，欺她，骗她，辱她，毁她，这一点一滴的血债，必须血偿。这辈子，亲情薄凉，她便摒弃亲情，父爱无情，她便不需要父爱，谁若待她不仁，就休怪她不义，顺便捡起上辈子错过的男人。据说，她宠夫如命，在外人面前冷漠无情，在她男人面前温顺的像只小绵', '/Public/images/nocover.jpg', 1550129740, 1550130333, 'nvpin', '23us', NULL, '第80章：借你肩膀靠一下', 79, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (89, '闪婚独宠：总裁大人难招架', NULL, '苏子', 'http://www.x23us.com/html/71/71526/', '被继母和妹妹设计，她当场受辱，攥着最后一丝尊严，她挺直腰杆，优雅转身：不配的，是你们！嫁入豪门算什么？她洛云瑶，要嫁，就要嫁给最有权势的男人！霍先生，你愿意娶我吗？我动能妩媚妖娆，静能贤惠大方，仅此一家，绝无分店！算命的说，我命中带煞，天生', '/Public/images/nocover.jpg', 1550129168, 1550130337, 'nvpin', '23us', NULL, '第二百六十九章：放手！', 268, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (90, '末世神魔录', NULL, '不冷的天堂', 'http://www.x23us.com/html/72/72425/', '何为末世？丧尸？魔怪？虫族？不！唯有当人类所恐惧的，所崇拜的，甚至是所幻想的一切都成为现实之时，才是人类真正的末日！灵气回涌，信仰重铸，这是神佛妖魔的饕餮盛宴，也是人类有史以来的最大浩劫！丧尸，异形，贞子，怪形，妖精鬼怪，神魔仙佛，这一切的', '/Public/images/nocover.jpg', 1550128678, 1550130340, 'nvpin', '23us', NULL, '0797 张良计与过墙梯！（四更补更）', 707, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (91, '华年', NULL, '亲亲雪梨', 'http://www.x23us.com/html/72/72159/', '港城市吉祥路，经营馄饨馆的乔家有三个孩子。其中有一个不是亲生的，街坊邻居虽都知道，但谁也没有点破过。故事从2002年开始，那一年中国队世界杯出线，那一年周杰伦、蔡依林、SHE风靡全亚洲，而对吉祥街的孩子们来说，火热的夏天和青春一起到来了…', '/uploads/0/91.jpg', 1550129677, 1550130348, 'nvpin', '23us', NULL, '第203章 留宿记（下）', 203, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (92, '圣恩隆宠，重生第一女神探', NULL, '晓闲月', 'http://www.x23us.com/html/72/72068/', '私人侦探庄思颜，穿越到大盛朝冷宫，被坑惨兮兮。幸得一美男相助，才终于站稳脚跟。可活下去是需要本事的，美男也是需要回报（抱）的。庄思颜身心俱陷，白天做神探，为美男断案寻踪，晚上是宠妃，暖床技巧不能停。谁让那美男就是皇上本人呢，为美色所惑的庄思', '/uploads/0/92.jpg', 1550129023, 1550130360, 'nvpin', '23us', NULL, '第483章 不是男子汉的作风', 479, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (93, '变身荒野女主播', NULL, '渴飞', 'http://www.x23us.com/html/69/69537/', '江湖人称她为‘珑爷’，但她却绝非一个男人……哦不对，她灵魂里住着一个男人！明明可以靠颜值，她偏偏要靠才华。明明可以吃软饭，她偏偏要自己打拼。明明可以让别人保护，她却练成了全世界最强的女人，哦不……应该是最强的人！这是一个重生女胖子，然后成为', '/Public/images/nocover.jpg', 1550130225, 1550130367, 'nvpin', '23us', NULL, '一千零五十九章 吓都吓死你。【情人节快乐】', 1149, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (94, '超品仙医', NULL, '绝品杜少', 'http://www.x23us.com/html/69/69030/', '他是让地下世界闻风丧胆的天神宙斯！他是华夏最神秘的一代兵魂！他医术逆天，一针生，一针死。当一代兵魂踏入花花都市，新的传奇就此开始。', '/uploads/0/94.jpg', 1550130293, 1550130375, 'nvpin', '23us', NULL, '第一千一百零四章 连环计', 1099, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (95, '带刀禁卫', NULL, '快剑江湖', 'http://www.x23us.com/html/69/69788/', '“嘿，中国小子，收起你的小胳膊小腿，这儿是禁区，不是你该待得地方。”每当有人提出这种质疑，斯努比总会抬起他的下巴，不屑的仰视着他。“听着，如果花生酱与汉堡包都没办法堵住你的嘴巴，那么你应该尝尝我的盖帽或者怒扣。”-【这是一个关于一名身高19', '/uploads/0/95.jpg', 1550128817, 1550130384, 'nvpin', '23us', NULL, '0745：【公爵条款】', 754, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (96, '农家小医妃', NULL, '作    者：木木帅', 'http://www.33xs.com/33xs/355/355009/', '民间传闻狐媚祸主，号称医毒天下第一的妖后孟长宁终于被陛下处死，大快人心！却不想孟长宁重生为农家女林长歌，还摊上了一家子奇葩，娘亲软弱无能，还有一个病秧子弟弟，在家地位堪忧。林长歌决定摆脱这种生活，重操旧业发家致富，然而她实在太穷了，连药材都', NULL, 1550130284, 1550130396, 'xuanhuan', '33xs_393', NULL, '大结局（下）咱们回家！！', 309, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (97, '太古魂帝', NULL, '作    者：七言绝', 'http://www.33xs.com/33xs/355/355012/', '修者为贼，窃天地养自身，窥大道立根基，损磨乾坤，为大道之孽，天地不容。各位书友要是觉得《太古魂帝》还不错的话请不要忘记向您QQ群和微博里的朋友推荐哦！', NULL, 1550128590, 1550130399, 'xuanhuan', '33xs_393', NULL, '第一千零五十二章 凶兽入侵', 1052, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (98, '大千劫主', NULL, '作    者：弄蛇者', 'http://www.33xs.com/33xs/355/355013/', '大衍之数五十，其用四十九也！当时间长河流淌万古，阴阳逆乱，时空轮转，苍穹震怒，雷霆降世，那其中之一的奇迹便由此而生！于是虚空裂开，一个普通青年穿越而来，以其血肉之躯，染红苍穹九重。......书友企鹅群：588577825微信公众号：non', NULL, 1550128841, 1550130403, 'xuanhuan', '33xs_393', NULL, '第一千四百八十章 神秘呢喃', 1485, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (99, '盛少，情深不晚', NULL, '作    者：忆江', 'http://www.33xs.com/33xs/355/355015/', '年轻幼稚的周沫被爸爸算计，稀里糊涂睡了高冷男神盛南平，阴差阳错生了儿子。盛南平恨透周沫三年后，为了救儿子，他必须和周沫再生一个孩子。周沫是有些怕盛南平的，婚后，她发现盛南平更可怕。“你，你要干什么？”“干该干的事儿，当年你费尽心机爬上我的床', NULL, 1550129568, 1550130408, 'xuanhuan', '33xs_393', NULL, '第902章 把事情搞清楚', 899, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (100, '毒妇不从良', NULL, '作    者：糖心没', 'http://www.33xs.com/33xs/355/355016/', '毒杀皇帝，戕害妃嫔，残戮皇嗣，祸乱朝纲，荼毒百姓，秽乱宫闱……这是她上辈子做过的事，这一世荣昭誓要——从良？笑话！既重生之，则斗争之，你们不入地狱谁入地狱。撕破伪善后母面具，揭穿心机妹妹阴谋，还有那个矫揉造作白莲花，咱们新仇旧恨一起算，我要', NULL, 1550128592, 1550130411, 'xuanhuan', '33xs_393', NULL, '537 终章', 535, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (101, '风铃渡', NULL, '作    者：花落成', 'http://www.33xs.com/33xs/355/355018/', '一个感恩图报的年轻人，意外的踏上不归路，一连串的变故，使他在苦难中苟且偷生，世事艰险，改变了他对世间的看法，按自己的习性和行动谱写了一曲生死、爱恨情仇的主题歌。各位书友要是觉得《风铃渡》还不错的话请不要忘记向您QQ群和微博里的朋友推荐哦！', NULL, 1550129751, 1550130415, 'xuanhuan', '33xs_393', NULL, '第四百一十七章 还不如去做乞丐', 415, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (102, '道缘浮图', NULL, '作    者：烟雨江', 'http://www.33xs.com/33xs/355/355019/', '谁家年少，煮酒调笑。盈握素腰，同舟醉邀。燕开庭的纨绔日子本来过得舒舒服服，走马章台，倾倒渭水，闲来无事再修修道，却不料被卷入一场仙家风波……各位书友要是觉得《道缘浮图》还不错的话请不要忘记向您QQ群和微博里的朋友推荐哦！', NULL, 1550129176, 1550130420, 'xuanhuan', '33xs_393', NULL, '章一五八 终章 一剑灭世', 153, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (103, '不朽永尊', NULL, '作    者：为情成', 'http://www.33xs.com/33xs/355/355023/', '玄幻星空，波澜壮阔，璀璨万古。少年苏文峰偶得血色空间，开启无上悟性，一路斩道向前，追逐永恒。资质、天赋不如他们？没关系，只要脑子比他们好使就行。“什么绝世妖孽、无敌大帝，还不是一样被我捶哭了。”各位书友要是觉得《不朽永尊》还不错的话请不要忘', NULL, 1550129854, 1550130423, 'xuanhuan', '33xs_393', NULL, '第83章 不是我强，是你太弱', 82, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (104, '天师打脸攻略', NULL, '作    者：蜗碎', 'http://www.33xs.com/33xs/355/355025/', '从出生那一刻起，就注定了姜昭悲剧的一生。重活一世，再次面对那群环伺身边的恶狼，她才发现，它们也不过如此而已。开灵眼、断阴阳、立天地，姜昭的天师之路，从打脸开始！各位书友要是觉得《天师打脸攻略》还不错的话请不要忘记向您QQ群和微博里的朋友推荐', NULL, 1550130218, 1550130430, 'xuanhuan', '33xs_393', NULL, '第885章 天师 （大结局）', 884, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (105, '女配总是被穿越', NULL, '作    者：凤栖桐', 'http://www.33xs.com/33xs/355/355026/', '谢子珺不明白为什么，她一个不学无术的废材女何德何能总是被各界大能看中穿越？谢子珺也想劝劝那些大能，这世上近百亿人口，总不能只挑一个穿是吧。做人嘛，还是雨露均沾的好。可这些大能非是不听呢，就得穿她，穿她，穿她！谢子珺无奈摊手：“那好，大家一起', NULL, 1550129462, 1550130433, 'xuanhuan', '33xs_393', NULL, '第四百一十二章 结局', 412, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (106, '保卫国师大人', NULL, '作    者：风行水', 'http://www.33xs.com/33xs/355/355036/', '如果他们也有朋友圈——大魔王：强弩灰飞烟灭，这天下终究如我所愿。[千里江山图.jpg]冯妙君：日常任务“阻挠冤家称霸天下“完成(1/1)，今天又愉快地活下来了呢^0^明天也要继续加油保住冤家的小命，维他命就是保我命。各位书友要是觉得《保卫国', NULL, 1550128769, 1550130437, 'xuanhuan', '33xs_393', NULL, '第640章 大结局（2）', 645, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (107, '大医凌然', NULL, '作    者：志鸟村', 'http://www.33xs.com/33xs/355/355040/', '医学院学生凌然有一个小目标，要成为世界上最伟大的医生，结果不小心实现了。各位书友要是觉得《大医凌然》还不错的话请不要忘记向您QQ群和微博里的朋友推荐哦！', NULL, 1550128813, 1550130440, 'xuanhuan', '33xs_393', NULL, '第531章 小世界其乐无穷', 536, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (108, '剑逆天穹', NULL, '作    者：EK巧', 'http://www.33xs.com/33xs/355/355039/', '某天才：杨秀来了？我的妈呀！快跑！某妖孽：靠，杨秀也参加？我算个毛！某天骄：防火防盗防杨秀，赶紧溜啊！杨秀：那个天才，那个妖孽，那个天骄，都给我站住！没有你们衬托，我还怎么秀？一位剑道天赋圆满的少年，剑指天下！专治各种天才、妖孽不服！天道压', NULL, 1550129574, 1550130445, 'xuanhuan', '33xs_393', NULL, '第688章 天下震怖', 697, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (109, '一战惊九霄', NULL, '作    者：夜雨闻', 'http://www.33xs.com/33xs/355/355042/', '——半颜回首执天戟，以吾龙血诛万逆。——半生荒唐，余生有你才安好。某日，一男一女立于山头，微风吹来，撩动几丝秀发，这时候女突然转头，追忆问道：你有弟弟吗？男愣了愣，眼神晃动，似乎想到了什么，答道：当然有。女：多大了？男眉头一皱，奇怪的看向女', NULL, 1550129908, 1550130448, 'xuanhuan', '33xs_393', NULL, '第七百七十一章 初次交手', 771, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (110, '抠神', NULL, '作    者：萧瑟良', 'http://www.33xs.com/33xs/355/355043/', '“同样是被系统砸中了头，别人的系统给钱花，我的系统不让我花钱。”“如果是没钱可花也就罢了，偏偏我是一个富二代。”“我这辈子，最痛苦的就是银行卡里有花不完的钱，但却不能花的感觉。”“为了省钱，我过上了不抽烟不喝酒不打麻将的佛系生活。”——被逼', NULL, 1550130208, 1550130451, 'xuanhuan', '33xs_393', NULL, '第四百四十六章 内讧', 443, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (111, '美男榜', NULL, '作    者：小鱼大', 'http://www.33xs.com/33xs/355/355046/', '隐世唐门出了两个败类。一是门主唐不休，二是他的女徒弟唐佳人。前者俊美无双，却是路痴，整日悟道，自称不休老祖，不肯为唐门传宗接代；后者蔫坏，罄竹难书！隐世唐门无精壮男子，长老们连哄带骗地将唐佳人推出唐门，让她去寻男子借种一用。临行前，长老怕佳', NULL, 1550130075, 1550130455, 'xuanhuan', '33xs_393', NULL, '第五百五十七章：神奇的倒卖', 554, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (112, '不死武皇', NULL, '作    者：妖月夜', 'http://www.33xs.com/33xs/355/355054/', '一门三帝尊，天阳照九天，无尽轮回路，谁来掌乾坤！本是万古奇才，却因武魂被夺，血脉受损，沦为庸人！夺取武魂之人，因为掌有双武魂，而受尽世人追捧，享受无上荣耀！四年后，姜辰凭借神奇的武魂之树，重新凝聚武魂，开启了一条雄霸九天的强者之路！你有无缺', NULL, 1550129533, 1550130458, 'xuanhuan', '33xs_393', NULL, '第841章 一斧之威', 840, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (113, '藏锋', NULL, '作    者：他曾是', 'http://www.33xs.com/33xs/355/355055/', '太子弑父，天降灾祸饿殍遍野。乞儿命苦，数九寒冬家破人亡。是谁说生死有命富贵在天？是谁说善恶有报因果轮回？尽是荒唐！弱肉强食，何来道义！物竞天择，何来公平！倒不如杀他个天昏地暗！倒不如杀他个天下太平！【书友一群：346162676欢迎加入】【', NULL, 1550129125, 1550130461, 'xuanhuan', '33xs_393', NULL, '后记 嗷呜', 789, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (114, '岭南宗师', NULL, '作    者：离人望', 'http://www.33xs.com/33xs/355/355058/', '地振高冈，一派西山千古秀门朝大海，三河合水万年流世道无常，打出七分情拳脚无眼，心留三分义红尘滚滚谁堪问铁骨铮铮大宗师各位书友要是觉得《岭南宗师》还不错的话请不要忘记向您QQ群和微博里的朋友推荐哦！', NULL, 1550129435, 1550130464, 'xuanhuan', '33xs_393', NULL, '第三百六十一章 命运安排好混入', 360, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (115, '星空之主', NULL, '作    者：八月飞', 'http://www.33xs.com/33xs/355/355063/', '新炎黄历八百年，世界早已告别古修真时代，步入现代。交流共赢，既竞争又合作是当前时代的主流。未知的道理，无尽的星空是所有修士共同的全新征途。一艘先进程度超越时代，却又来历神秘的彼岸神舟，载着少年沈健驶向宇宙大海航时代。新时代修真，未来在星空，', NULL, 1550130302, 1550130467, 'xuanhuan', '33xs_393', NULL, '501.处境对调', 500, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (116, '我家学生能改变历史', NULL, '作    者：烽火成', 'http://www.33xs.com/33xs/355/355065/', '沉迷游戏不可自拔的李白，每天阅读鸡汤的武则天，学好数理化走到哪里都不怕的墨子，整天捣鼓火药的霍去病。作为这些历史人物的老师，主角表示压力很大，因为一不小心将他们教偏了，那么华夏的历史就会大变模样。《我家客人你惹不起》已经完结。各位书友要是觉', NULL, 1550130454, 1550130471, 'xuanhuan', '33xs_393', NULL, '375章大结局', 376, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (117, '重生支配者', NULL, '作    者：历史里', 'http://www.33xs.com/33xs/355/355066/', '方修做了一个梦——梦里，他成为了一个畅游在时间长河之上的存在。有种说法是人类是生活在四维宇宙的三维生物，每一个三维生物都是时间长河里的一粒沙子，只能够随着时间维度的河流顺流而下，而他则是河里的一条鱼，可以顺着游，也可以逆流而上，甚至跳出时间', NULL, 1550129502, 1550130477, 'xuanhuan', '33xs_393', NULL, '第四百零九章： 西渡之人', 409, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (118, '永恒武道', NULL, '作    者：月中阴', 'http://www.33xs.com/33xs/355/355067/', '基因是人类禁区，是神之领域，掌握了基因的奥秘，那就掌握了神的力量！大名鼎鼎的“基因武道理论”道尽了武道强者力量的来源，练习武功，打破自身基因锁，成就“非人”，这就是武道的真谛。大三学生林峰，意外得到了基因融合器，走上了基因融合之路。别人练武', NULL, 1550128643, 1550130481, 'xuanhuan', '33xs_393', NULL, '完本感言和新书预告', 1974, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (119, '厨艺大师', NULL, '作    者：墨老黑', 'http://www.33xs.com/33xs/355/355068/', '有人说：在成为大师的路上，是艰辛的、孤独的。伊凡说：不，我可以让它变得很有味道。各位书友要是觉得《厨艺大师》还不错的话请不要忘记向您QQ群和微博里的朋友推荐哦！', NULL, 1550128809, 1550130486, 'xuanhuan', '33xs_393', NULL, '第109章 打造奇女子', 108, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (120, '我到异界放卫星', NULL, '作    者：韦小宝', 'http://www.33xs.com/33xs/355/355072/', '带着3008年的资源卫星，穿越到异界。炼武什么的弱爆了，啥秘籍弄不到？打仗什么的兄弟真不会，可敌人在哪儿，看一眼就知道了。赚钱啥的就不说了，守着资源卫星。首富啥的，真心懒得作，钱够用就行。各位书友要是觉得《我到异界放卫星》还不错的话请不要忘', NULL, 1550129824, 1550130489, 'xuanhuan', '33xs_393', NULL, '第四百一十九章 季高先生', 420, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (121, '仙尊归来', NULL, '作    者：乌山云', 'http://www.33xs.com/33xs/355/355073/', '地球少年意外踏入异世千年，成就仙尊，引动真仙劫时，重生回到地球的少年时代！各位书友要是觉得《仙尊归来》还不错的话请不要忘记向您QQ群和微博里的朋友推荐哦！', NULL, 1550129196, 1550130498, 'xuanhuan', '33xs_393', NULL, '第200章 仙生漫漫（终）', 198, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (122, '天才魔法师与天然呆勇者', NULL, '作    者：小呆昭', 'http://www.33xs.com/33xs/355/355075/', 'so，这只是一本简单的恋爱向轻喜剧奇幻小说啦~有着“未来最强魔法师”之称的少年在小镇邂逅了一只迷迷糊糊的勇者少女，属于他们的青春恋爱物语在这一刻拉开了序幕~本书男女老少皆宜，看腻了各种套路，就来这里换换口味吧~热乎乎新鲜出炉的QQ群：194', NULL, 1550130235, 1550130502, 'xuanhuan', '33xs_393', NULL, '后记及新书', 762, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (123, '杨小落的便宜奶爸', NULL, '作    者：寒门', 'http://www.33xs.com/33xs/355/355076/', '蝉鸣鸟唱的夏夜，杨言站在小区门口，高高拎起一个大袋子，扬声笑喊：“落落，回家吃冰镇西瓜咯！”嗖！一只短腿的柯基迫不及待地从花丛里钻了出来，摇着小屁股，兴奋地跑向杨言。随后，一个小女孩坐在一只大乌龟的壳上，慢慢悠悠地从大树后面绕了出来，她明亮', NULL, 1550130244, 1550130506, 'xuanhuan', '33xs_393', NULL, '第441章 那个橘子会魔法（1/3）', 442, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (124, '绝天武帝', NULL, '作    者：苍天霸', 'http://www.33xs.com/33xs/355/355079/', '弹指天地覆，拔剑神魔伏！绝代神王千年后醒来，发一言天下皆惊，镇服盖世天骄；行一步风云色变，踏灭举世恶敌！以无敌之姿扫灭天下！猛力更新中，求收藏和推荐票！各位书友要是觉得《绝天武帝》还不错的话请不要忘记向您QQ群和微博里的朋友推荐哦！', NULL, 1550129817, 1550130508, 'xuanhuan', '33xs_393', NULL, '第1275章 《鬼狱心经》', 1272, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (125, '召唤梦魇', NULL, '作    者：滚开', 'http://www.33xs.com/33xs/355/355082/', '这是一个普通人能从噩梦中获得力量，所发生的故事……林盛突然有一天，发现自己平凡普通的日常里，多出了一点异样。一个不断重复的噩梦，让他开始了一段无法形容的诡异旅程。一个庞大的梦魇，一个迷幻的秘密。各位书友要是觉得《召唤梦魇》还不错的话请不要忘', NULL, 1550129148, 1550130511, 'xuanhuan', '33xs_393', NULL, '105 苦修 3', 104, 0, 0, 0, 0);
