INSERT INTO `yg_articles` VALUES (127, '拜见大魔王', NULL, '作    者：蒜书', 'http://www.33xs.com/33xs/218/218501/', '螟，低等魔族，偶然获得了一些非常非常非常残破的记忆，还有一个系统商城…….一个需要光明点的系统商城，故事由此展开！简单地说，这就是个低等魔族利用系统在地球和异界之间穿梭，逐渐成长为大魔王的故事。各位书友要是觉得《拜见大魔王》还不错的话请不要', NULL, 1550129156, 1550130516, 'xuanhuan', '33xs_393', NULL, '第二百五十四章 热恋', 524, 0, 0, 0, 0);
