INSERT INTO `yg_articles` VALUES (129, '璀璨王牌', NULL, '作    者：夜醉木', 'http://www.33xs.com/33xs/216/216252/', '为了信仰而战。渴望着一切战斗的胜利。即刻飞翔，飞向那变幻莫测的球场。红土场上的荣光，钻石王牌的骄傲。一如钻石般的璀璨。傲立于球场中央，那最为闪耀夺目的炫彩。便是王者最为诚挚的誓言！！我们是谁！？王者青道！！！各位书友要是觉得《璀璨王牌》还不', NULL, 1550129964, 1550130520, 'xuanhuan', '33xs_393', NULL, '第五百三十二章 克里斯前辈的回归', 522, 0, 0, 0, 0);
