INSERT INTO `yg_articles` VALUES (131, '神火凌天', NULL, '作    者：君戴笠', 'http://www.33xs.com/33xs/351/351574/', '任谁也不会想到，冰冷与枯寂的宇宙深处，还有着一块飘浮的大陆。罗昊怀惴着要将天捅个窟窿的宏大志愿来到了这里。只是，他究竟是回到了上古，还是来到了星空的彼岸？昆吾古国、眼中世界、天族罗姓、地族后氏、天宫虚影、还有来自地球的八角琉璃井，这一切和原', NULL, 1550128739, 1550130525, 'xuanhuan', '33xs_393', NULL, '第1979章 极道的力量', 1980, 0, 0, 0, 0);
