INSERT INTO `yg_articles` VALUES (133, '万古神帝', NULL, '作    者：飞天鱼', 'http://www.33xs.com/33xs/322/322788/', '八百年前，明帝之子张若尘，被他的未婚妻池瑶公主杀死，一代天骄，就此陨落。八百年后，张若尘重新活了过来，却发现曾经杀死他的未婚妻，已经统一昆仑界，开辟出第一中央帝国，号称“池瑶女皇”。池瑶女皇——统御天下，威临八方；青春永驻，不死不灭。张若尘', NULL, 1550129323, 1550130529, 'xuanhuan', '33xs_393', NULL, '第2211章 不惜一切代价', 2209, 0, 0, 0, 0);
