INSERT INTO `yg_articles` VALUES (135, '超级兵王混都市', NULL, '作    者：风火江', 'http://www.33xs.com/33xs/351/351783/', '【兵王归龙城，打脸从不停！】他是华夏超级兵王，更是让所有势力恐惧的杀神猎鹰！一次任务，让他回归都市，保护绝美未婚妻。从此，都市风云，将因他而动！各位书友要是觉得《超级兵王混都市》还不错的话请不要忘记向您QQ群和微博里的朋友推荐哦！', NULL, 1550128916, 1550130538, 'xuanhuan', '33xs_393', NULL, '第3922章 真是个天才', 3914, 0, 0, 0, 0);
