INSERT INTO `yg_articles` VALUES (137, '武道大帝', NULL, '作    者：忘情至', 'http://www.33xs.com/33xs/322/322197/', '少年罗修出身卑微，天赋一般，却意外融合生死法则本源所化至宝，从此身藏诸天生死轮，执掌轮回，开创无上神通，成就一代大帝，傲视古今。各位书友要是觉得《武道大帝》还不错的话请不要忘记向您QQ群和微博里的朋友推荐哦！', NULL, 1550129662, 1550130546, 'xuanhuan', '33xs_393', NULL, '第三千七百八十七章 三大神灵级生物', 3758, 0, 0, 0, 0);
