INSERT INTO `yg_articles` VALUES (149, '万界疯人院', NULL, '作    者：肥瓜', 'http://www.33xs.com/33xs/219/219043/', '不知从什么时候起，世界上有了这样的一座精神病医院。它曾出现在哥谭市最繁华的街边，也曾经藏在浣熊市最阴暗的角落，它可能在《福尔摩斯探案集》中有过一小段的描写，也可能在《汉尼拔》的影片中有过一秒钟的画面......有人说，里面穿着护士服的女孩有', NULL, 1550129074, 1550130595, 'xuanhuan', '33xs_393', NULL, '第二十二章 他来自天堂（完）', 134, 0, 0, 0, 0);
