INSERT INTO `yg_articles` VALUES (152, '天道圣尊', NULL, '作    者：龙腾万', 'http://www.33xs.com/33xs/332/332426/', '大道三千皆为天道，宇宙亿万位面均属天道法则之内，神王仙帝皆不敢违背，一切均在定数，不可逆天而行。大道五十，天衍四九，却仍留一线生机，徘徊天道之外，逆天生长，不屈命数。李峰的横空出世是打破天道法则的契机，成就天道圣尊。Q群：283626822', NULL, 1550129611, 1550130602, 'xuanhuan', '33xs_393', NULL, '第777章 臻至神位境', 777, 0, 0, 0, 0);
