INSERT INTO `yg_articles` VALUES (156, '重生娇妻：小军嫂，有点甜', NULL, '作    者：天青地', 'http://www.33xs.com/33xs/232/232274/', '（1V1甜蜜宠文）重生回到一九七二年，赵暖月再也不愿意被所谓的亲人道德绑架，做任人摆布的玩偶。她要用自己的能力保护弟弟，并且亲手报前世之仇。前世的恩人昏迷在床，她自愿成为冲喜媳妇，成了他的妻子。单打独斗，转变成组合双打，吊打前世那些心狠手辣', NULL, 1550128902, 1550130614, 'xuanhuan', '33xs_393', NULL, '第一千一百四十三章 取舍，奇怪的照片', 1138, 0, 0, 0, 0);
