INSERT INTO `yg_articles` VALUES (184, '雷法为王', NULL, '作    者：山向水', 'http://www.33xs.com/33xs/354/354854/', '道法神通万千，且看我雷法为王。仙，神，佛，魔，妖鼎立，一个卑微的仆役获得雷法传承，搅乱这鼎立恒久的局势。（本书慢热，大概会在五百万字以上，请放心收藏。）各位书友要是觉得《雷法为王》还不错的话请不要忘记向您QQ群和微博里的朋友推荐哦！', NULL, 1550129815, 1550130714, 'xiuzhen', '33xs_393', NULL, '第157章 威胁仙剑', 926, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (185, '洪荒之功德天榜', NULL, '作    者：神奇明', 'http://www.33xs.com/33xs/354/354865/', '亿万神魔笑傲混沌鸿蒙，开天之后还剩几何？三千混沌魔神，开鸿蒙，劈混沌，练乾坤，化万物，天地之后又剩几人？龙，凤，麒麟，巫，妖、人等亿万种族争霸洪荒世界，最后谁胜谁负？佛、道、魔..万道争锋，所争为何？人族又何以威压亿万种族，成为天地主角？女', NULL, 1550130160, 1550130717, 'xiuzhen', '33xs_393', NULL, '第三百八十一章 灵源！归一！混元！', 379, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (186, '我的左手有丹炉', NULL, '作    者：清风云', 'http://www.33xs.com/33xs/354/354867/', '穿越啦！一尊来自修真世界的丹炉穿越到了张岳左手！自动衍化丹方，炼丹成功率百分之百。有了如此强悍的丹炉，张岳踏上成为无上仙尊之路。培元丸，增强体质，一颗下去就变得力大无穷。破壁丹，突破先天，让武道宗师晋级为人间神话。剑丹，传说中的飞剑也可以用', NULL, 1550129442, 1550130720, 'xiuzhen', '33xs_393', NULL, '第360章 终', 359, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (187, '逆天真形', NULL, '作    者：暴打一', 'http://www.33xs.com/33xs/354/354871/', '古武传承，逆天真形，一名帝国奴隶，在这璀璨的诅咒星河，打破枷锁，迎击古老之敌，成就无上武道真身。各位书友要是觉得《逆天真形》还不错的话请不要忘记向您QQ群和微博里的朋友推荐哦！', NULL, 1550130435, 1550130723, 'xiuzhen', '33xs_393', NULL, '上架感言', 131, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (188, '逆血苍生', NULL, '作    者：灭度莜', 'http://www.33xs.com/33xs/354/354889/', '万般道法，千般天算，唯执吾念...掌生！各位书友要是觉得《逆血苍生》还不错的话请不要忘记向您QQ群和微博里的朋友推荐哦！', NULL, 1550129110, 1550130726, 'xiuzhen', '33xs_393', NULL, '第三百八十二章 假山', 382, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (189, '修仙之一路开挂', NULL, '作    者：万吨小', 'http://www.33xs.com/33xs/354/354890/', '董小球，李相，姒非，龙牧…亿万年来…我到底是谁？各位书友要是觉得《修仙之一路开挂》还不错的话请不要忘记向您QQ群和微博里的朋友推荐哦！', NULL, 1550129619, 1550130729, 'xiuzhen', '33xs_393', NULL, '509.上马下马', 501, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (190, '超级古武战士系统', NULL, '作    者：小飞猴', 'http://www.33xs.com/33xs/354/354892/', '侯不凡前世被人追杀，在他生命即将消失时，却意外地穿越到武侠大陆中，还幸运地得到《超级古武战士系统》，在这以武为尊的大陆上，麻烦会源源不断地找上你，为了活着，他不得不打起十二分精神。........................已完本《奇剑', NULL, 1550128686, 1550130732, 'xiuzhen', '33xs_393', NULL, '第1036章：大结局（完）', 1032, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (191, '武竞天择', NULL, '作    者：二十六', 'http://www.33xs.com/33xs/354/354898/', '【古武未来征文获奖作品】武！强身健体佑己身，侠！守护心中那一份执着。科技时代，古武没落。忽暗黑临世，异乱丛生、人间秩序崩毁，世界陷入恐怖的天择毁灭之中。于混乱黑暗中，一名懵懂少年，执一册九极卷，习无上古武，灭生化、斗进化、破天择、斩混乱，还', NULL, 1550128959, 1550130735, 'xiuzhen', '33xs_393', NULL, '第五百九十九章 未来无限美好（全书完结）', 598, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (192, '我在洪荒有座山', NULL, '作    者：问鱼', 'http://www.33xs.com/33xs/354/354908/', '女娲赐生，通天传法！李烛影在洪荒世界占山为王，寻求大道逍遥。（新人挖坑，经成千上...万书友鉴定，此书有毒！不喜勿喷，文明阅读你我共行，如有雷同也没办法！）各位书友要是觉得《我在洪荒有座山》还不错的话请不要忘记向您QQ群和微博里的朋友推荐哦', NULL, 1550129400, 1550130742, 'xiuzhen', '33xs_393', NULL, '第497章 养胎与主神系统', 499, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (193, '修行在三千小世界', NULL, '作    者：金天猪', 'http://www.33xs.com/33xs/354/354909/', '前世武，仙，神三系同修，超脱原本的世界后进入三千小世界转世重修。只不过这一世不需要再争分夺秒，心平气和，一步一个脚印，慢慢来，不要急，先炼个法宝，再炼个金丹，没事教教徒弟，无聊就教教上门挑战的少女如何做女侠。积累修行，只为了再次超脱，破开三', NULL, 1550129440, 1550130746, 'xiuzhen', '33xs_393', NULL, '第一百一十七章劫终飞升', 610, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (194, '仙道隐名', NULL, '作    者：故飘风', 'http://www.33xs.com/33xs/354/354913/', '一个普通的凡间少年，偶然之下，带着一颗肉球，一只蚊子，还有一只蚂蚁，在波谲诡异的修仙世界里，四处闯荡，仗剑天涯……本书循序渐进，请书友们多加指正，书友群：473450711，欢迎入群讨论。各位书友要是觉得《仙道隐名》还不错的话请不要忘记向您', NULL, 1550128913, 1550130750, 'xiuzhen', '33xs_393', NULL, '第一千一百三十一章 银沙垄', 1131, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (195, '加点仙尊', NULL, '作    者：周天子', 'http://www.33xs.com/33xs/354/354917/', '金无止穿越修仙界，身怀超级加点系统，修为太低？加点！遇到瓶颈？加点！功法太烂？加点！我加加加，无意间就加成了霸主。各位书友要是觉得《加点仙尊》还不错的话请不要忘记向您QQ群和微博里的朋友推荐哦！', NULL, 1550130117, 1550130754, 'xiuzhen', '33xs_393', NULL, '450 （全书完）', 468, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (196, '龙飞大地', NULL, '作    者：暮雪云', 'http://www.33xs.com/33xs/354/354924/', '五千年前，巨龙统治世界，人类只是巨龙的食物之一；统治者之间的争斗，黑龙被杀死，龙魂被封印于地下；五千年后，没错，就是现在，就是今天，巨龙即将觉醒，人类又将面临最残酷的劫难；文明退回到原始社会；人类为了躲避巨龙的捕食，像老鼠一样昼伏夜出；除非', NULL, 1550129854, 1550130759, 'xiuzhen', '33xs_393', NULL, '第484章 鸡飞狗跳的生活（大结局）', 483, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (197, '奋斗在西游', NULL, '作    者：鬼笔子', 'http://www.33xs.com/33xs/354/354936/', '“八戒，放开这个女施主，让贫僧来...”“老沙，我的药带了没？”唐僧提枪上马，突然问道。一部西游八百怪！其中多少女妖精？阿弥那个陀佛，妖精，贫僧度你们来了...各位书友要是觉得《奋斗在西游》还不错的话请不要忘记向您QQ群和微博里的朋友推荐哦', NULL, 1550129687, 1550130763, 'xiuzhen', '33xs_393', NULL, '第二四六章 原来这才是因果！（超长大结局）', 245, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (198, '请叫我宗主大人', NULL, '作    者：最爱吃', 'http://www.33xs.com/33xs/354/354939/', '越级挑战？临阵突破？不这些哪有碾压敌人来得痛快．这是一本系统穿越流的正确打开方式.在万界种田，做万界宗主．各位书友要是觉得《请叫我宗主大人》还不错的话请不要忘记向您QQ群和微博里的朋友推荐哦！', NULL, 1550130172, 1550130766, 'xiuzhen', '33xs_393', NULL, '第一一二零章 大结局', 1117, 0, 0, 0, 0);
INSERT INTO `yg_articles` VALUES (199, '锦衣内卫', NULL, '作    者：受伤的', 'http://www.33xs.com/33xs/354/354950/', '公元1368年，明太祖朱元璋创建大明王朝，至此一个维持了将近三百年的朝代就此诞生，在明初期，太祖朱元璋因朝廷新立内忧外患等原因需建立一个可以直属与他的直辖机构能够为他更加有力的办事，所以将自己的拱卫司改编成锦衣卫，在负责拱卫、礼仪之外更增加', NULL, 1550128931, 1550130771, 'xiuzhen', '33xs_393', NULL, '第四百一十八章 巅峰对决（完本）', 399, 0, 0, 0, 0);
