-- Table structure for yg_articles
-- ----------------------------
DROP TABLE IF EXISTS `yg_articles`;
CREATE TABLE `yg_articles` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(150) NOT NULL,
  `pinyin` varchar(50) DEFAULT NULL COMMENT '拼音',
